import React, { useState } from "react";
import deleteIcon from "../assets/image/delete.svg";

export default function Match({match}) {
const [incrementValue, setIncrementValue] =useState("")
const [decrementValue, setDecrementValue] =useState("")

  return (
    <div class="match" id="singleMatch">
      <div class="wrapper">
        <button class="lws-delete">
          <img src={deleteIcon} alt="" />
        </button>
        <h3 class="lws-matchName">Match {match.name} </h3>
      </div>
      <div class="inc-dec">
        <form class="incrementForm">
          <h4>Increment</h4>
          <input type="number" name="increment" class="lws-increment" value={inc} />
        </form>
        <form class="decrementForm">
          <h4>Decrement</h4>
          <input type="number" name="decrement" class="lws-decrement" />
        </form>
      </div>
      <div class="numbers">
        <h2 class="lws-singleResult" id="score">
          {match.score}
        </h2>
      </div>
    </div>
  );
}
